// TabelaValores.js
import React from 'react';

const TabelaValores = (props) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Artista</th>
          <th>Appearances</th>
          <th>%</th>
        </tr>
      </thead>
      <tbody>
        {props.dados.map((item, index) => (
          <tr key={index}>
            <td>{item.nome}</td>
            <td>{item.valor}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default TabelaValores;
